Luos is like a task that has to be run regularly. So you will have to run it by adding luos_init() and luos_loop() in the main() of your program. Basically, your main() will look like this: #include "luos.h" int main(void)
{ Luos_Init(); while(1) { Luos_Loop(); } return 0;
} Putting this code into a nodeHardware element (MCU) hosting and running Luos and hosting one or several containers. makes it able to react to a Luos network. It's now ready to host your containers. As a developer you will always develop your functionalities into containers and never into the main() program. Note: The only information that should be put on the main() code are MCU setup parameters and containers' run functions.

