When the JSON routing table is transmitted, the Gate starts to update and stream your network data with containers information . This JSON is a "container" object listing all the containers by their alias and the values they send: { "containers":{ "container_alias1":{ "value1":12.5 }, "container_alias2":{ "value1":13.6, "value2":[1, 2, 3, 4] } }
