ut the rotation angle of the associated potentiometer: { "containers":{ "potentiometer_m":{ "rot_position":12.5 } }
} Here is an exemple of a message sent by a gate container about Luos statistic: { "containers":{ "gate":{ "luos_statistics":{ "msg_stack":60, "luos_stack":53, "msg_drop":0, "loop_ms":16, "fail_ratio":0, "nak_max":1, "collision_max":5, } } }
} Custom parameters and specific messages Some messages are specifically handled: Custom parameters can be defined and sent to containers through the JSON API, either with Python (Pyluos) or any other programming language on a computer side. Here is an example of a C function that can be implemented in order to send commands to containers in a Luos Network, through a gate: def sendCmd(s, cmd, sleep_time=0.5): cmd = cmd + '\r' print(cmd) s.write(cmd.encode()) time.sleep(sleep_time)
